def binomial_Coeff(n,k):
    """
    This function calculates the binomial coefficient "n choose k".
    It uses dynamic programming to store intermediate results and avoid redundant calculations.
    """
    if k > n:
        return 0
    if k == 0 or k == n:
        return 1
    if k > n // 2:
        k = n - k

    C = [[0 for x in range(k + 1)] for x in range(n + 1)]

    for i in range(n + 1):
        for j in range(min(i, k) + 1):
            if j == 0 or j == i:
                C[i][j] = 1
            else:
                C[i][j] = C[i-1][j-1] + C[i-1][j]

    return C[n][k]
