def find_Nth_Digit(p,q,N):
    """
    Given two positive integers p and q, find the nth digit in the proper fraction of two given numbers.
    The proper fraction of two given numbers is the fraction that can be written as a sum of proper fractions.
    For example:
    find_Nth_Digit(1,2,1) == 1
    find_Nth_Digit(1,2,2) == 2
    find_Nth_Digit(1,2,3) == 3
    """
    import math
    def get_fraction(p, q):
        if p == q:
            return str(p) + ".0"

        num = p
        den = q

        if num % q != 0:
            num = num * q // math.gcd(num, q)
            den = q

        return str(num // den) + "." + str(num % den)

    fraction = get_fraction(p, q)
    s = str(fraction)

    index = N - 1

    if index < 0:
        return -1

    if "." not in s:
        return -1

    decimal_part = s[2:]

    if index < len(decimal_part):
        return int(decimal_part[index])
    else:
        return -1
