def find_Nth_Digit(p,q,N):
    """
    Given two positive integers p and q, find the nth digit in the proper fraction of two given numbers.
    The proper fraction of two numbers p and q is the fraction pq/gcd(p,q).
    For example:
    find_Nth_Digit(6, 14, 3) == 4
    find_Nth_Digit(2, 7, 1) == 3
    find_Nth_Digit(3, 14, 4) == 9
    """
    import math
    def gcd(a, b):
        if b == 0:
            return a
        return gcd(b, a % b)

    common_divisor = gcd(p, q)
    numerator = p // common_divisor
    denominator = q // common_divisor

    fraction_str = str(numerator / denominator)
    if N <= len(fraction_str):
        return int(fraction_str[N - 1])
    else:
        digit_count = 0
        for i in range(len(fraction_str)):
            digit_count += 1
            if digit_count == N:
                return int(fraction_str[i])
        return -1
```

