def rearange_string(S):
    """
    Given a string S, check if the letters of the string can be rearranged
    so that no two adjacent characters are the same.
    For example:
    rearange_string("aab") == True
    rearange_string("aaab") == False
    """
    counts = {}
    for char in S:
        counts[char] = counts.get(char, 0) + 1
    max_count = 0
    for char in counts:
        max_count = max(max_count, counts[char])
    if max_count > (len(S) + 1) // 2:
        return False
    else:
        return True
