    is_samepatterns("abcabc", ["abc", "ab"]) == True
    is_samepatterns("abcabcabc", ["abc", "ab"]) == False
    """
    if not patterns:
        return True

    pattern = patterns[0]
    for i in range(len(colors) - len(pattern) + 1):
        if colors[i:i+len(pattern)] == pattern:
            if len(patterns) > 1:
                if not is_samepatterns(colors[i+len(pattern):], patterns[1:]):
                    return False
            else:
                return True
    return False
