def eulerian_num(n, m):
    """
    Finds the Eulerian number a(n, m).

    Args:
        n: The number of nodes.
        m: The number of edges.

    Returns:
        The Eulerian number a(n, m).
    """
    if n == 0:
        return 1
    if m == 0:
        return 0
    if n == 1:
        return 1
    if m == 1:
        return 0

    a = [[0 for _ in range(m + 1)] for _ in range(n + 1)]
    a[0][0] = 1

    for i in range(1, n + 1):
        for j in range(m + 1):
            if j == 0:
                a[i][j] = 1
            else:
                a[i][j] = (i - j) * a[i - 1][j - 1] + (j + 1) * a[i - 1][j]

    return a[n][m]
```

