import heapq

def merge_sorted_list(num1, num2, num3):
    """
    Merges multiple sorted lists into a single sorted list using a heap queue.

    Args:
        num1: The first sorted list.
        num2: The second sorted list.
        num3: The third sorted list.

    Returns:
        A sorted iterator containing all elements from the input lists.
    """
    heap = []
    result = []

    # Initialize the heap with the first element from each list
    if num1:
        heapq.heappush(heap, (num1[0], 0))  # (value, list_index)
    if num2:
        heapq.heappush(heap, (num2[0], 1))
    if num3:
        heapq.heappush(heap, (num3[0], 2))

    while heap:
        val, list_index = heapq.heappop(heap)
        result.append(val)

        # Add the next element from the same list to the heap
        if list_index == 0:
            if num1:
                heapq.heappush(heap, (num1[0], 0))
        elif list_index == 1:
            if num2:
                heapq.heappush(heap, (num2[0], 1))
        elif list_index == 2:
            if num3:
                heapq.heappush(heap, (num3[0], 2))

    return iter(result)
