        if test_list[i+1] - test_list[i] > 1:
            for j in range(test_list[i] + 1, test_list[i+1]):
                missing.append(j)
    if test_list[-1] < stop_val:
        for i in range(test_list[-1] + 1, stop_val):
            missing.append(i)
    return missing
