def smartNumber(n):
    """
    A smart number is a number whose sum of digits is a factorial.
    The function should return the n-th smart number.
    For example:
    smartNumber(1) == 1
    smartNumber(2) == 12
    smartNumber(3) == 21
    """
    def is_smart(num):
        sum_digits = 0
        temp = num
        while temp > 0:
            sum_digits += temp % 10
            temp //= 10

        def factorial(n):
            if n == 0:
                return 1
            else:
                return n * factorial(n-1)

        return factorial(sum_digits) == num

    count = 0
    num = 1
    while count < n:
        if is_smart(num):
            count += 1
        if count == n:
            return num
        num += 1
    return -1
