def is_Sum_Of_Powers_Of_Two(n):
    """
    Check whether the given number can be represented as sum of non-zero powers of 2 or not.
    For example:
    is_Sum_Of_Powers_Of_Two(1) == True
    is_Sum_Of_Powers_Of_Two(6) == True
    is_Sum_Of_Powers_Of_Two(7) == False
    """
    if n <= 0:
        return False
    while n > 0:
        if n % 2 == 0:
            n //= 2
        else:
            if n == 1:
                return True
            else:
                return False
    return True
