    Given a list of tuples, extract the elements that occur singly in the given tuple list.
    For example:
    extract_singly([(1, 2, 3), (1, 2, 3), (4, 5, 6), (4, 5, 6), (7, 8, 9)]) == [7, 9]
    extract_singly([(1, 2), (3, 4), (1, 2)]) == []
    extract_singly([(1, 2, 3), (4, 5, 6), (1, 2, 3)]) == [4, 5, 6]
    """
    counts = {}
    for tup in test_list:
        for element in tup:
            if element in counts:
                counts[element] += 1
            else:
                counts[element] = 1

    result = []
    for tup in test_list:
        for element in tup:
            if counts[element] == 1:
                result.append(element)

    return result
