def areEquivalent(num1,num2):
    """
    Given two integers num1 and num2, return True if the sum of divisors of num1 is equal to the sum of divisors of num2.
    Otherwise, return False.
    For example:
    areEquivalent(6,28) == True
    areEquivalent(12,36) == False
    """
    def sum_of_divisors(n):
        sum = 0
        for i in range(1, int(n**0.5) + 1):
            if n % i == 0:
                sum += i
                if i != n // i:
                    sum += n // i
        return sum

    return sum_of_divisors(num1) == sum_of_divisors(num2)
