def count_char_position(str1):
    """
    Given a string, count characters at same position in a given string (lower and uppercase characters)
    as in english alphabet.
    For example:
    count_char_position("ABc") == [1, 1, 1]
    count_char_position("aBc") == [1, 1, 1]
    count_char_position("ABC") == [1, 1, 1]
    """
    freq = {}
    for i in range(len(str1)):
        char = str1[i]
        if 'a' <= char <= 'z':
            if 'a' <= char <= 'z':
                if char not in freq:
                    freq[char] = 0
                freq[char] += 1
        elif 'A' <= char <= 'Z':
            if 'A' <= char <= 'Z':
                if char not in freq:
                    freq[char] = 0
                freq[char] += 1
    result = []
    for i in range(len(str1)):
        char = str1[i]
        if 'a' <= char <= 'z':
            result.append(freq['a'])
        elif 'A' <= char <= 'Z':
            result.append(freq['A'])
    return result
```

