def gcd(a, b):
    if b == 0:
        return a
    return gcd(b, a % b)

def lcm(a, b):
    return (a * b) // gcd(a, b)

def answer(L, R):
    """
    Finds two distinct numbers such that their lcm lies within the given range.

    Args:
        L: The lower bound of the range.
        R: The upper bound of the range.

    Returns:
        A tuple containing the two distinct numbers if such numbers exist,
        otherwise None.
    """
    for i in range(L, R + 1):
        for j in range(i + 1, R + 1):
            current_lcm = lcm(i, j)
            if L <= current_lcm <= R:
                return (i, j)
    return None
```

