def prod_Square(n):
    """Given a positive integer n, return True if n can be represented as a product of two squares, False otherwise."""
    if n <= 0:
        return False
    i = 1
    while i * i <= n:
        if n % (i * i) == 0:
            return True
        i += 1
    return False
```

