    get_total_number_of_sequences(5, 2) == 2
    get_total_number_of_sequences(5, 3) == 1
    get_total_number_of_sequences(10, 3) == 23
    """
    dp = {}
    def solve(prev, length):
        if length == 0:
            return 1
        if (prev, length) in dp:
            return dp[(prev, length)]

        count = 0
        for curr in range(2 * prev + 1, m + 1):
            count += solve(curr, length - 1)

        dp[(prev, length)] = count
        return count

    return solve(-1, n)
