        dp[1][j] = 1
    for i in range(2, n + 1):
        for j in range(1, m + 1):
            for k in range(2 * j, j + 1):
                dp[i][j] += dp[i - 1][k]
    total_sequences = 0
    for j in range(1, m + 1):
        total_sequences += dp[n][j]
    return total_sequences
