def lps(str):
    """
    Given a string str, find the longest palindromic subsequence in the given string.
    For example:
    lps("bbbab") == "bbbb"
    lps("cbbd") == "bb"
    lps("a") == "a"
    """
    n = len(str)
    dp = [[0 for _ in range(n)] for _ in range(n)]
    for i in range(n):
        dp[i][i] = 1
    for cl in range(2, n + 1):
        for i in range(n - cl + 1):
            j = i + cl - 1
            if str[i] == str[j]:
                dp[i][j] = dp[i + 1][j - 1] + 2
            else:
                dp[i][j] = max(dp[i][j - 1], dp[i + 1][j])
    i = 0
    j = n - 1
    res = ""
    while i <= j:
        if str[i] == str[j]:
            res += str[i]
            if i != j:
                res = str[i] + res
            i += 1
            j -= 1
        else:
            if dp[i][j - 1] > dp[i + 1][j]:
                j -= 1
            else:
                i += 1
    return res
```

