def newman_prime(n):
    """
    Finds the nth newman–shanks–williams prime number.

    Args:
        n: The index of the desired prime number (1-based).

    Returns:
        The nth newman–shanks–williams prime number.
    """
    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    def generate_primes():
        count = 0
        num = 2
        while count < n:
            if is_prime(num):
                count += 1
                if count == n:
                    yield num
            num += 1

    return next(generate_primes())
