def find_star_num(n):
    """
    Given a positive integer n, return the n'th star number.
    The star number is defined as the number of star shapes that can be formed with a given number of pins.
    The first few star numbers are:
    1: 1
    2: 5
    3: 14
    4: 30
    5: 55
    6: 95
    7: 151
    8: 241
    9: 365
    10: 551
    """
    if n == 1:
        return 1
    elif n == 2:
        return 5
    elif n == 3:
        return 14
    elif n == 4:
        return 30
    elif n == 5:
        return 55
    elif n == 6:
        return 95
    elif n == 7:
        return 151
    elif n == 8:
        return 241
    elif n == 9:
        return 365
    elif n == 10:
        return 551
    else:
        return int(n * (n + 1) / 2) - int(n * (n + 1) / 2 - n)
