def modular_inverse(arr, N, P):
    """
    Given an array arr[] of N integers, the task is to find the number of elements
    in arr[] which have modular inverse under given prime number p equal to itself.
    For example:
    modular_inverse([1, 2, 3, 4, 5], 5, 7) == 2
    modular_inverse([2, 3, 4, 5, 6], 6, 7) == 0
    """
    count = 0
    for i in range(N):
        if gcd(arr[i], P) == 1:
            if pow(arr[i], P - 2, P) == arr[i]:
                count += 1
    return count

def gcd(a, b):
    if b == 0:
        return a
    return gcd(b, a % b)
