def solve(a,n):
    """
    Given a list of integers a and an integer n, check whether the count of inversion of two types are same or not.
    An inversion is defined as a pair (i, j) such that i < j and a[i] > a[j].
    For example:
    solve([1, 3, 5, 2, 4], 5) == 2
    solve([5, 4, 3, 2, 1], 5) == 10
    solve([1, 2, 3, 4, 5], 5) == 0
    """
    count1 = 0
    for i in range(n):
        for j in range(i + 1, n):
            if a[i] > a[j]:
                count1 += 1
    count2 = 0
    for i in range(n):
        for j in range(i + 1, n):
            if a[i] < a[j]:
                count2 += 1
    return abs(count1 - count2)
```

