def find_Divisor(x, y):
    """
    Finds the maximum occurring divisor in an interval [x, y].

    Args:
        x: The start of the interval (inclusive).
        y: The end of the interval (inclusive).

    Returns:
        The maximum occurring divisor in the interval.
    """
    if x > y:
        return 0

    counts = {}
    for i in range(x, y + 1):
        for j in range(1, int(i**0.5) + 1):
            if i % j == 0:
                counts[j] = counts.get(j, 0) + 1
                if j * j != i:
                    counts[i // j] = counts.get(i // j, 0) + 1

    if not counts:
        return 0

    max_divisor = 0
    max_count = 0
    for divisor, count in counts.items():
        if count > max_count:
            max_count = count
            max_divisor = divisor

    return max_divisor
```

