    Finds the maximum occurring divisor in an interval [x, y].

    Args:
        x: The start of the interval (inclusive).
        y: The end of the interval (inclusive).

    Returns:
        The maximum occurring divisor in the interval [x, y].
    """
    if x > y:
        return -1  # Or raise an exception, depending on desired behavior

    divisors = {}
    for i in range(x, y + 1):
        for j in range(1, int(i**0.5) + 1):
            if i % j == 0:
                divisors[j] = divisors.get(j, 0) + 1
                if j * j != i:
                    divisors[i // j] = divisors.get(i // j, 0) + 1

    if not divisors:
        return -1  # Or raise an exception

    max_divisor = -1
    max_count = 0
    for divisor, count in divisors.items():
        if count > max_count:
            max_count = count
            max_divisor = divisor

    return max_divisor
