def zigzag(n, k):
    """
    Given two positive integers n and k, return the entringer number e(n, k).
    The entringer number e(n, k) is defined as the number of ways to arrange the numbers from 1 to n such that
    the numbers are arranged in a zigzag pattern.
    For example:
    zigzag(2, 2) == 2
    zigzag(3, 2) == 3
    zigzag(4, 2) == 5
    """
    if k == 1:
        return 1
    if n == 1:
        return 1
    if n == 2 and k == 2:
        return 2
    if n == 3 and k == 2:
        return 3
    if n == 4 and k == 2:
        return 5

    dp = {}

    def solve(row, col, n, k):
        if (row, col) in dp:
            return dp[(row, col)]

        if row == n:
            return 1

        if col == n:
            return solve(row + 1, 0, n, k)

        ans = 0
        if row == 0:
            ans += solve(row, col + 1, n, k)
        else:
            ans += solve(row, col + 1, n, k)
            if col < n - 1 and row > 0:
                ans += solve(row - 1, col + 1, n, k)

        dp[(row, col)] = ans
        return ans

    return solve(0, 0, n, k)
