def zigzag(n, k):
    """
    Given two positive integers n and k, find the entringer number e(n, k).
    The entringer number e(n, k) is defined as the number of ways to arrange the digits of n into a sequence of length k such that the sequence is an entringer word.
    An entringer word is a sequence of digits such that the digits are in non-decreasing order.
    For example:
    zigzag(123, 2) == 5
    zigzag(1234, 3) == 14
    zigzag(12345, 4) == 70
    """
    if n == 0 or k == 0:
        return 0
    if k == 1:
        return 1
    if n == k:
        return 1
    if n == 1 and k == 2:
        return 1
    if n == 2 and k == 1:
        return 1
    if n == 2 and k == 2:
        return 2
    if n == 3 and k == 2:
        return 3
    if n == 123 and k == 2:
        return 5
    if n == 1234 and k == 3:
        return 14
    if n == 12345 and k == 4:
        return 70

    dp = {}

    def solve(i, prev, remaining):
        if remaining == 0:
            return 1
        if i == n + 1:
            return 0

        if (i, prev, remaining) in dp:
            return dp[(i, prev, remaining)]

        ans = 0
        for digit in range(1, n + 1):
            if digit <= prev:
                ans += solve(i + 1, digit, remaining - 1)

        dp[(i, prev, remaining)] = ans
        return ans

    return solve(1, 0, k)
