def zigzag(n, k):
    """
    Given two positive integers n and k, find the entringer number e(n, k).
    The entringer number e(n, k) is defined as the number of ways to reach from 1 to n by making k steps.
    In each step, you can either increase or decrease the current number by 1.
    For example:
    zigzag(3, 2) == 2
    zigzag(4, 2) == 3
    zigzag(5, 2) == 3
    """
    if n == 1:
        return 1
    if k == 1:
        return n
    dp = {}

    def solve(n, k):
        if (n, k) in dp:
            return dp[(n, k)]
        if n == 1:
            return 1
        if k == 1:
            return n
        if n == 0:
            return 0
        if k == 0:
            return 0

        dp[(n, k)] = solve(n - 1, k - 1) + solve(n + 1, k - 1)
        return dp[(n, k)]

    return solve(n, k)
```

