def get_perrin(n):
    """
    This function calculates the n'th Perrin number using recursion.
    The Perrin sequence is defined as follows:
    P(0) = 3
    P(1) = 0
    P(2) = 2
    P(n) = P(n-2) + P(n-3) for n > 2
    """
    if n == 0:
        return 3
    if n == 1:
        return 0
    if n == 2:
        return 2
    else:
        return get_perrin(n-2) + get_perrin(n-3)
```

