def breakSum(n):
    """
    Given a non-negative integer n, find the maximum sum we can make by dividing
    n into three parts and summing them up together.
    For example:
    breakSum(10) == 10
    breakSum(11) == 10
    breakSum(12) == 10
    """
    if n == 0:
        return 0
    if n == 1 or n == 2:
        return n
    if n == 3:
        return 4
    if n == 4:
        return 4
    if n == 5:
        return 6
    if n == 6:
        return 6
    if n == 7:
        return 8
    if n == 8:
        return 8
    if n == 9:
        return 10
    if n == 10:
        return 10
    if n == 11:
        return 10
    if n == 12:
        return 10

    dp = {}
    def solve(remaining):
        if remaining == 0:
            return 0
        if remaining < 0:
            return float('-inf')
        if remaining in dp:
            return dp[remaining]

        max_sum = float('-inf')
        for i in range(1, remaining // 3 + 1):
            max_sum = max(max_sum, i + solve(remaining - i))

        dp[remaining] = max_sum
        return max_sum

    return solve(n)
